import React from 'react';
import attachmentservice from '../services/AttachmentServices';
import {Navbar, Button} from 'react-bootstrap';



class AttachmentComponents extends React.Component{


    constructor(props){
        super(props)
        this.state ={
            attachments:[]
        }

    }
        componentDidMount(){
                attachmentservice.getAttachment().then((Response)=>{
                    this.setState({attachments:Response.data})
                });
    }
    render(){
        return(
            <div>
                <Navbar bg ="black" variant="dark">
                    <Button variant="outline-info" Align-right>Search</Button>
                    </Navbar>
                <h1 className = "text-center"> M16</h1>
                <table>
                    <thead>
                        <tr>
                            <th>Barrel</th>
                            <th>Scope</th>
                            <th>Magazine</th>
                            <th>Grip</th>
                        </tr>
                    </thead>

                    <tbody>
                        {
                           
                            this.state.attachments.map(
                                attachment =>
                               
                                    <td key={attachment.id}> 

                                       
                                        <select>
                                        <option value = "Attachment1">
                                        {attachment.attachment1} </option>

                                        <option value = "Attachment2">
                                        {attachment.attachment2}</option>
                                        
                                        <option value = "Attachment3">
                                        {attachment.attachment3} </option>

                                        <option value = "Attachment4">
                                        {attachment.attachment4} </option>
                                        
                                        </select>
                                        
                                    </td>

                            
                            )

                        }
                    </tbody>
                  

                </table>      
            </div>

        )
    }
}
export default AttachmentComponents
